func main() {
	s, err := filepath.Abs(filepath.Join(".", "config", "file.sock"))
	if err != nil {
		fmt.Fprintln(os.Stderr, err)
		os.Exit(0)
	}

	var socketPath = flag.String("config", s, "path to dir with config socketPath")
	flag.Args()

	lis, err := net.ListenUnix("unix", &net.UnixAddr{Name: *socketPath, Net: "unix"})
	if err != nil {
		fmt.Fprintln(os.Stderr, err)
		os.Exit(0)
	}

	server := grpc.NewServer()
	var (
		blockchain *minter.Blockchain
		tmRPC      *rpc.Local
		cfg        *config.Config
	)
	pb.RegisterManagerServiceServer(server, service.NewManager(blockchain, tmRPC, cfg))
	err = server.Serve(lis)
	if err != nil {
		fmt.Fprintln(os.Stderr, err)
		return
	}

	sigs := make(chan os.Signal, 1)
	signal.Notify(sigs, syscall.SIGINT, syscall.SIGTERM)

	<-sigs
	server.GracefulStop()
}
